function Route(props) {
  const { selectedDay } = props;

  let content;
  if (selectedDay === 1) {
    content = <div>Day 1 Route</div>;
  } else if (selectedDay === 2) {
    content = <div>Day 2 Route</div>;
  } else {
    content = <div>Day 3 Route</div>;
  }
}

export default Route;
